import { createCharacter } from '../../redux/actions/characterActions';

export function displayAddCharacterModal(setAddCharacterModalView, addCharacterModalView) {
  setAddCharacterModalView(!addCharacterModalView);
}

export function addNewCharacter(character, userId, characterValues, dispatch) {
  const newCharacter = { ...character };
  newCharacter.name = characterValues.newCharacterName;
  newCharacter.game = characterValues.newCharacterGame;
  newCharacter.race = characterValues.newCharacterRace;
  newCharacter.class = characterValues.newCharacterClass;
  newCharacter.lvl = characterValues.newCharacterLvl;
  newCharacter.owner = userId;
  debugger;

  dispatch(createCharacter(newCharacter));
}
